import '../../../App.css';

export default function MSGContent(props){
  return (
    <div className='msgContentComponent'>
        <div className='msgFromFirst'>
          <div id="msgContentName">{props.name}</div>
          <div id="msgContentDate">{props.date}</div>
        </div>
        <div id='msgFromContent'>{props.content}</div>
      </div>
  )
}
